import React from 'react';
import { withRouter } from 'react-router-dom';
import './home.scss';
import { Menu, Button } from 'antd';
import {
  // AppstoreOutlined,
  // MenuUnfoldOutlined,
  // MenuFoldOutlined,
  PieChartOutlined,
  // DesktopOutlined,
  // ContainerOutlined,
  MailOutlined,
} from '@ant-design/icons';
const { SubMenu } = Menu;
class MenuCom extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      // collapsed: false,
    };
  }
  // toggleCollapsed = () => {
  //   this.setState({
  //     collapsed: !this.state.collapsed,
  //   });
  // };
  render() {

    // 由于 `this.handleClick` 已经绑定至实例，因此我们才可以用它来处理点击事件
    return (
      <div className="home" style={{ width: 170 }}>
        {/* <Button type="primary" onClick={this.toggleCollapsed} style={{ marginBottom: 16 }}>
          {React.createElement(this.state.collapsed ? MenuUnfoldOutlined : MenuFoldOutlined)}
        </Button> */}
        <Menu
          defaultSelectedKeys={['1']}
          // defaultOpenKeys={['sub1']}
          mode="inline"
          theme="dark"
        >
          <Menu.Item key="1">
            Option 1
          </Menu.Item>
          <SubMenu key="sub1" title="Navigation One">
            <Menu.Item key="2">Option 5</Menu.Item>
            <Menu.Item key="3">Option 6</Menu.Item>
            <Menu.Item key="4">Option 7</Menu.Item>
            <Menu.Item key="5">Option 8</Menu.Item>
          </SubMenu>
        </Menu>
      </div>
    );
  }
}

export default withRouter(MenuCom);
